import React from 'react';
import VideoItem from './VideoItem';

class VideoList extends React.Component{
    render(){
        const renderList = this.props.dataList.map(x => {
        return <VideoItem video = {x}/> });
        return(
            <div>
            </div>
        );
    }
}

export default VideoList;
